import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    height: 800px;
    margin: 0 auto;
    overflow: hidden;
    min-width: 1200px;

`
export const Divtop = styled.div`
    width: 94%;
    height: 4%;
    margin: 27px auto;
    margin-left: 3%;
    border-radius: 5px;
    overflow: hidden;

`

export const Divleft = styled.div`
    width: 55%;
    height: 85%;
    margin-top: 1.7%;
    float: left;
    margin-left: 5%;
    min-width: 575px;

`
export const Divright=styled.div`
    float: right;
    width: 35%;
    height: 70%;
    margin-top: 5%;
    margin-right: 5%;
    margin-left: 0%;
`
